      Allcode.hasMany(models.Schedule, {
        foreignKey: "timeType",
        as: "timeTypeData",
      });
      Allcode.hasMany(models.Hotpot, {
        foreignKey: "priceId",
        as: "priceData",
      });
      Allcode.hasMany(models.Hotpot, {
        foreignKey: "paymentId",
        as: "paymentData",
      });
      Allcode.hasMany(models.Hotpot, {
        foreignKey: "provinceId",
        as: "provinceData",
      });
    }
  }
  Allcode.init(
    {
      keyMap: DataTypes.STRING,
      type: DataTypes.STRING,
      valueEn: DataTypes.STRING,
      valueVi: DataTypes.STRING,
    },
    {
      sequelize,
      modelName: "Allcode",
    }
  );
  return Allcode;
};

